'''Green d'hide gold-trimmed armour''' is a set of [[Ranged armour]] that has identical bonuses as [[Green d'hide armour]]. Pieces of the armour can be obtained as rewards from [[Clue scroll (medium)|medium]] [[Treasure Trails]]. The set consists of only body and chaps.

